import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import Dropdown from 'react-bootstrap/Dropdown';

export default function App() {
  state = {
    showMessage: false
  }

  const handleOther = () => {
    this.setState({showMessage: true});
  }

  return (
    <div style={{ display: 'block', 
                  width: 700, 
                  padding: 30 }}>
      <h4>Select Data Set Type</h4>
      <Dropdown>
        <Dropdown.Toggle variant="primary">
          Select
        </Dropdown.Toggle>
        <Dropdown.Menu>
          <Dropdown.Item href="#">
            Pk Study
          </Dropdown.Item>
          <Dropdown.Item href="#">
            IVT Study
          </Dropdown.Item>
          <Dropdown.Item href="#" onClick={handleOther}>
            Other
          </Dropdown.Item>
        </Dropdown.Menu>
      </Dropdown>
    </div>
  );
}
